    "a-raptor-survey-of-the-canning-and-kongakut-rivers-arctic-national-wildlife-refuge-alaska-",nt"isopen":
    false,nt"url": null,nt"notes": "The Alaska National Interest Lands Conservation
    Act (ANILCA) directs the Department of the Interior to assess the potential for
    oil and natural gas resources of the coastal plain of the Arctic National Wildlife
    Refuge (ANWR). Industry and agency (U.S. Geological Survey) efforts to evaluate
    the oil and gas resources of the coastal plain require geological investigations
    that bring an unprecedented level of human activity to the north slope of the ANWR.
    It is important for land managers to have current information available to them
    so unnecessary disturbances to sensitive species, such as birds of prey, can be
    avoided. To serve this end and also in an on-going effort, the Endangered Species
    Division of the Fish and Wildlife Service (FWS) has conducted surveys and banding
    studies of Arctic and American Peregrine Falcons (Falco peregrinus tundrius and
    Falco peregrinus anatum) in key use areas of Alaska since 1979. This report summarizes
    surveys done on the Canning and Kongakut Rivers in 1984.",nt"license_title":
